query:
/*+ NoMergeJoin(mc t) NoNestLoop(mc t mi) */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id > 160 AND mc.company_type_id > 1 AND t.kind_id < 7 AND t.production_year > 1917
inner join movie_info AS mi
on t.id = mi.movie_id AND mi.info_type_id = 16;
